    true,nt"url": null,nt"notes": "<p>The TES Individual dataset contains information
    at the individual-level about the persons who attend a GLS funded training event.
    This dataset includes variables that describe the trainees including their demographics
    and the primary setting and role within the setting where the trainee interacts
    with youth, the ways in which they intend to use their training, the impact of the
    training in terms of the usefulness, practicality, and applicability of the training
    to the trainees life. (State/Tribal - October 2006 through September 2013; Campus
    - October 2010 through September 2015)</p>n",nt"license_title": "Other License
